import React, {useState} from 'react'
import './main.css';
// import logo from './background.jpg';


export default function Login() {
    const [inputData, setData] = useState(
       { name:'' ,
        email : ''}
    );

    const hanldeSubmit = () => {
        console.log(inputData);
    }

  return (
  <>
     <section>
     {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <div className='form-outer'>
            
            <div className='box'>
                <div className='circle-box'>
                    
                   <h2 className='mb-3 text-white text-center'>Login</h2>
                </div>
                <form onSubmit={hanldeSubmit}>
                    <input type="text" className='form-control mb-4' 
                    value={inputData.name} 
                    name="name" onChange={(e) => setData(e.target.value)} 
                    placeholder='E-Mail ID' />

                    <input type="password" className='form-control mb-4' 
                    value={inputData.email} 
                    name="email" onChange={(e) => setData(e.target.value)}
                    placeholder='Password' />

                    <button type="button" className='btn btn-outline-warning text-white'>Submit</button>
                    </form>
                </div>
        </div>
     </section>
  </>
  )
}
